import React, { useState } from 'react';
import LabelStyle1 from './labels/LabelStyle1';

function ToggleButton() {
  const [isStudent, setIsStudent] = useState(true);

  return (
    <div className="flex items-center justify-center rounded-lg bg-white border border-gray-100 border-1 w-[30px] h-[10px] m-5">
       <label className="w-full h-full text-blue-500 font-semibold flex items-center justify-center text-center" style={{ fontSize: "clamp(8px, 1vw, 14px)"}}>Student</label>
    </div>
  );
}

export default ToggleButton;
